package main

import (
	"fmt"
	"regexp"
	"strings"
)

var input = ``

func task1() int {
	alma := handlePolymer(input)
	huhu := strings.Split(alma, "")
	return len(huhu)
}

func task2() int {
	chars, found := strings.Split(input, ""), false
	distinct := make([]string, 0)
	for _, char := range chars {
		found = false
		for _, d := range distinct {
			if strings.ToLower(char) == strings.ToLower(d) {
				found = true
				break
			}
		}
		if !found {
			distinct = append(distinct, strings.ToLower(char))
		}
	}
	min, replaced, huhu := len(chars), "", []string{}
	for _, char := range distinct {
		reg := regexp.MustCompile(char + "|" + strings.ToUpper(char))
		replaced = reg.ReplaceAllString(input, "")
		replaced = handlePolymer(replaced)
		huhu = strings.Split(replaced, "")
		if len(huhu) < min {
			min = len(huhu)
		}
	}
	return min
}

func handlePolymer(str string) string {
	res, found := "", false
	chars := strings.Split(str, "")
	for i := 0; i < len(chars); i++ {
		if i+1 < len(chars) && chars[i] != chars[i+1] && (chars[i] == strings.ToLower(chars[i+1]) || strings.ToLower(chars[i]) == chars[i+1]) {
			found = true
			i++
		} else {
			res += chars[i]
		}
	}
	if found {
		str = handlePolymer(res)
	}
	return str
}

func main() {
	//fmt.Println(task1())
	fmt.Println(task2())
}
